tables.table_schema:
CREATE TABLE network_performance_metrics (
    id INT PRIMARY KEY,
    timestamp TIMESTAMP,
    host VARCHAR,
    latency FLOAT
);

CREATE TABLE network_errors (
    error_id INT PRIMARY KEY,
    timestamp TIMESTAMP,
    host VARCHAR,
    error_message TEXT
);

CREATE TABLE network_devices (
    device_id INT PRIMARY KEY,
    device_name VARCHAR(50) NOT NULL,
    ip_address VARCHAR(15) NOT NULL,
    location VARCHAR(50) NOT NULL
);

CREATE TABLE network_logs (
    log_id SERIAL PRIMARY KEY,
    timestamp TIMESTAMP NOT NULL,
    device_id INT NOT NULL,
    log_message TEXT
);

CREATE TABLE network_analysis (
    analysis_id SERIAL PRIMARY KEY,
    device_id INT NOT NULL,
    timestamp TIMESTAMP NOT NULL,
    analysis_result TEXT
);

CREATE TABLE network_devices (
    device_id UUID PRIMARY KEY,
    device_name VARCHAR(50) NOT NULL,
    device_type VARCHAR(20) NOT NULL
);

CREATE TABLE network_logs (
    log_id UUID PRIMARY KEY,
    timestamp TIMESTAMP NOT NULL,
    message TEXT,
    device_id UUID REFERENCES network_devices(device_id)
);

CREATE TABLE network_errors (
    error_id UUID PRIMARY KEY,
    error_message TEXT NOT NULL,
    timestamp TIMESTAMP NOT NULL,
    log_id UUID REFERENCES network_logs(log_id)
);

CREATE TABLE network_analytics (
    analytics_id UUID PRIMARY KEY,
    average_latency FLOAT,
    packet_loss_rate FLOAT,
    timestamp TIMESTAMP NOT NULL
);
